//handling user signup
app.post("/signup",function(req,res,next){
	//we need to use body parser now......cuz data form se le rahe hain
	req.body.namee
	req.body.email
	req.body.pass
	User.register(new User({username: req.body.namee}),req.body.pass,function(err,user){
		//we don't save passwords to the data base and hence it is passed after the username and not in it.
		if(err) {
			console.log(err);
			res.render("campgrounds/signup");
		}
		else{
			//console.log(email);
			//console.log(username);
			passport.authenticate("local", function(err, user, info) {

    if (err) return next(err); 
    if (!user) return res.redirect('/login'); 

    req.logIn(user, function(err) {
        if (err)  return next(err); 
        return res.redirect("/campgrounds/secret");
    });

})(req, res, next);
		}
	});
});	

